import React, {useState} from "react";
import FormSignup from "./FormSignup";

function Login() {

    const [sign, setSign] = useState(true)
    return (
        <div className="login">
            <br /><br /><br />
            {sign? (<FormSignup/>) : (<FormLogin />)}
          
        </div>
      );
}

export default Login
